import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Container from '@mui/material/Container';
import Button from '@mui/material/Button';
import useMediaQuery from '@mui/material/useMediaQuery';
import PersonAddAltIcon from '@mui/icons-material/PersonAddAlt';
import LogoutIcon from '@mui/icons-material/Logout';
import DeleteSweepIcon from '@mui/icons-material/DeleteSweep';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import IconButton from '@mui/material/IconButton/IconButton';
import ListIcon from '@mui/icons-material/List';
import ApiAccess from '../services/api-access';
import { useHistory } from 'react-router-dom';
import routes from '../helpers/routes';
import SlideDialog from './MaterialModal';
import { Snackbar, Stack } from '@mui/material';
import ConnectedAccount from '../models/ConnectedAccount';
import Loader from './loader';
import library from '../helpers/library';
import Title from './Title';
import CloseIcon from '@mui/icons-material/Close';
import Account from '../models/Account';
import cookieServiceInstance from '../services/cookies';

const leftButtons = [library.studentRegister, library.dbSweep];
const rightButtons = [library.accountList, library.profil, library.deconnection];
const unconnectedButtons = [library.connexion, library.register];

const NavBar: React.FunctionComponent = () => {

    const isMediumScreen = useMediaQuery('(max-width: 800px)');
    const [isConnected, setConnexion] = React.useState(false);
    const [isAdmin, setRole] = React.useState(false);
    const [loading, setLoading] = React.useState(false);
    const [isLogoutDialogOpen, setLogoutDialog] = React.useState(false);
    const [isClearDialogOpen, setClearDialog] = React.useState(false);
    const [isConnexionSnackOpen, setSnack] = React.useState(false);

    React.useEffect(() => {
        if (ConnectedAccount.id) {
            ConnectedAccount.connect(new Account())
            
        }
        retrieveDataAfterLoad();
    }, []);

    function retrieveDataAfterLoad() {
        if(cookieServiceInstance.getCookie(library.account)) {
            ConnectedAccount.connect(JSON.parse(cookieServiceInstance.getCookie(library.account)!));
            ConnectedAccount.authToken = cookieServiceInstance.getCookie(library.token)!;
        }
        setRole(ConnectedAccount.roleB);
    }

    document.addEventListener('DOMContentLoaded', retrieveDataAfterLoad);

    if (ConnectedAccount.username) {
        setRole(ConnectedAccount.roleB);
        setConnexion(true);
    }

    const LogoutManagement = async () => {
        setLoading(true);
        try {
            await ApiAccess.logout();
        } finally {
            goToPage(routes.connexion);
            setLogoutDialog(false);
            setLoading(false);
            window.location.reload();
        }
    }

    const ClearBase = () => {
        ApiAccess.clearBase();
    }

    const history = useHistory();

    const goToPage = (path: any) => {
        history.push(path);
    };

    const openLogoutDialog = () => {
        setLogoutDialog(true);
    }

    const closeLogoutDialog = () => {
        setLogoutDialog(false);
    }

    const openClearDialog = () => {
        setClearDialog(true);
    }

    const closeClearDialog = () => {
        setClearDialog(false);
    }

    const openConnexionSnack = () => {
        setSnack(true);
    }

    const closeSnack = () => {
        setSnack(false);
    }

    const action = (
        <React.Fragment>
          <IconButton
            size="small"
            aria-label="close"
            color="inherit"
            onClick={closeSnack}
          >
            <CloseIcon fontSize="small" />
          </IconButton>
        </React.Fragment>
      );

    return (
        <React.Fragment>
            <AppBar position="static">
                <Container maxWidth="xl">
                    <Toolbar sx={{ justifyContent: 'space-between' }} disableGutters>
                        <Box>
                            {isConnected ? (
                                <>
                                    {isAdmin ? (
                                        <>
                                            {isMediumScreen ? (
                                                <>
                                                    <Box>
                                                        <IconButton
                                                            size="large"
                                                            aria-label="accounts list"
                                                            aria-haspopup="true"
                                                            color="inherit"
                                                            onClick={() => goToPage(routes.addstudent)}
                                                        >
                                                            <PersonAddAltIcon />
                                                        </IconButton>
                                                        <IconButton
                                                            size="large"
                                                            aria-label="account update"
                                                            aria-haspopup="true"
                                                            color="inherit"
                                                            onClick={openClearDialog}
                                                        >
                                                            <DeleteSweepIcon />
                                                        </IconButton>
                                                    </Box>
                                                    <Title />
                                                    <Box>
                                                        <IconButton
                                                            size="large"
                                                            aria-label="accounts list"
                                                            aria-haspopup="true"
                                                            color="inherit"
                                                            onClick={() => goToPage(routes.accounts)}
                                                        >
                                                            <ListIcon />
                                                        </IconButton>
                                                        <IconButton
                                                            size="large"
                                                            aria-label="account update"
                                                            aria-haspopup="true"
                                                            color="inherit"
                                                            onClick={() => goToPage(routes.profil)}
                                                        >
                                                            <AccountCircleIcon />
                                                        </IconButton>
                                                        <IconButton
                                                            size="large"
                                                            aria-label="deconnection"
                                                            aria-haspopup="true"
                                                            color="inherit"
                                                            onClick={openLogoutDialog}
                                                        >
                                                            <LogoutIcon />
                                                        </IconButton>
                                                    </Box>
                                                </>
                                            ) : (
                                                <>
                                                    <Stack>
                                                        <Button key={leftButtons[0]} sx={{ color: 'inherit' }} onClick={() => goToPage(routes.addstudent)}>
                                                            {leftButtons[0]}
                                                        </Button>
                                                        <Button key={leftButtons[1]} sx={{ color: 'inherit' }} onClick={openClearDialog}>
                                                            {leftButtons[1]}
                                                        </Button>
                                                    </Stack>
                                                    <Title />
                                                    <Stack spacing={1} direction="row">
                                                        <Button key={rightButtons[0]} sx={{ color: 'inherit' }} onClick={() => goToPage(routes.accounts)}>
                                                            {rightButtons[0]}
                                                        </Button>
                                                        <Button key={rightButtons[1]} sx={{ color: 'inherit' }} onClick={() => goToPage(routes.profil)}>
                                                            {rightButtons[1]}
                                                        </Button>
                                                        <Button key={rightButtons[2]} sx={{ color: 'inherit' }} onClick={openLogoutDialog}>
                                                            {rightButtons[2]}
                                                        </Button>
                                                    </Stack>
                                                </>
                                            )}
                                        </>
                                    ) : (
                                        <>
                                            {isMediumScreen ? (
                                                <>
                                                    <Box>
                                                        <IconButton
                                                            size="large"
                                                            aria-label="accounts list"
                                                            aria-haspopup="true"
                                                            color="inherit"
                                                            onClick={() => goToPage(routes.addstudent)}
                                                        >
                                                            <PersonAddAltIcon />
                                                        </IconButton>
                                                    </Box>
                                                    <Title />
                                                    <Box>
                                                        <IconButton
                                                            size="large"
                                                            aria-label="account update"
                                                            aria-haspopup="true"
                                                            color="inherit"
                                                            onClick={() => goToPage(routes.profil)}
                                                        >
                                                            <AccountCircleIcon />
                                                        </IconButton>
                                                        <IconButton
                                                            size="large"
                                                            aria-label="deconnection"
                                                            aria-haspopup="true"
                                                            color="inherit"
                                                            onClick={openLogoutDialog}
                                                        >
                                                            <LogoutIcon />
                                                        </IconButton>
                                                    </Box>
                                                </>
                                            ) : (
                                                <>
                                                    <Stack spacing={1} direction="row">
                                                        <Button key={leftButtons[0]} sx={{ color: 'inherit' }} onClick={() => goToPage(routes.addstudent)}>
                                                            {leftButtons[0]}
                                                        </Button>
                                                    </Stack>
                                                    <Title />
                                                    <Stack spacing={1} direction="row">
                                                        <Button key={rightButtons[1]} sx={{ color: 'inherit' }} onClick={() => goToPage(routes.profil)}>
                                                            {rightButtons[1]}
                                                        </Button>
                                                        <Button key={rightButtons[2]} sx={{ color: 'inherit' }} onClick={openLogoutDialog}>
                                                            {rightButtons[2]}
                                                        </Button>
                                                    </Stack>
                                                </>
                                            )}
                                        </>
                                    )}
                                </>
                            ) : (
                                <>
                                    {isMediumScreen ? (
                                        <>
                                            <Box>
                                                <IconButton
                                                    size="large"
                                                    aria-label="accounts list"
                                                    aria-haspopup="true"
                                                    color="inherit"
                                                    onClick={openConnexionSnack}
                                                >
                                                    <PersonAddAltIcon />
                                                </IconButton>
                                                <IconButton
                                                    size="large"
                                                    aria-label="account update"
                                                    aria-haspopup="true"
                                                    color="inherit"
                                                    onClick={openConnexionSnack}
                                                >
                                                    <DeleteSweepIcon />
                                                </IconButton>
                                            </Box>
                                            <Title />
                                            <Box>
                                                <IconButton
                                                    size="large"
                                                    aria-label="accounts list"
                                                    aria-haspopup="true"
                                                    color="inherit"
                                                    onClick={() => goToPage(routes.accounts)}
                                                >
                                                    <ListIcon />
                                                </IconButton>
                                                <IconButton
                                                    size="large"
                                                    aria-label="account update"
                                                    aria-haspopup="true"
                                                    color="inherit"
                                                    onClick={() => goToPage(routes.profil)}
                                                >
                                                    <AccountCircleIcon />
                                                </IconButton>
                                                <IconButton
                                                    size="large"
                                                    aria-label="deconnection"
                                                    aria-haspopup="true"
                                                    color="inherit"
                                                    onClick={openLogoutDialog}
                                                >
                                                    <LogoutIcon />
                                                </IconButton>
                                            </Box>
                                        </>
                                    ) : (
                                        <>
                                            <Stack spacing={1} direction="row">
                                                <Button key={leftButtons[0]} sx={{ color: 'inherit' }} onClick={openConnexionSnack}>
                                                    {leftButtons[0]}
                                                </Button>
                                                <Button key={leftButtons[1]} sx={{ color: 'inherit' }} onClick={openConnexionSnack}>
                                                    {leftButtons[1]}
                                                </Button>
                                            </Stack>
                                            <Title />
                                            <Stack spacing={1} direction="row">
                                                <Button key={unconnectedButtons[0]} sx={{ color: 'inherit' }} onClick={() => goToPage(routes.connexion)}>
                                                    {unconnectedButtons[0]}
                                                </Button>
                                                <Button key={unconnectedButtons[1]} sx={{ color: 'inherit' }} onClick={() => goToPage(routes.register)}>
                                                    {unconnectedButtons[1]}
                                                </Button>
                                            </Stack>
                                        </>
                                    )}
                                </>
                            )}
                        </Box>
                    </Toolbar>
                </Container>
            </AppBar >

            <SlideDialog isOpen={isLogoutDialogOpen} onClose={closeLogoutDialog} onConfirm={LogoutManagement} title={'Deconnexion'}>
                {loading ? (
                    <Loader />
                ) : (
                    <>
                        <p>Vous allez vous dconnecter</p>
                        <p>tes vous sr de continuer ?</p>
                    </>
                )}
            </SlideDialog>

            <SlideDialog isOpen={isClearDialogOpen} onClose={closeClearDialog} onConfirm={ClearBase} title={'Vider la base'}>
                {loading ? (
                    <Loader />
                ) : (
                    <>
                        <p>Vous allez vider la base de donne</p>
                        <p>Cette action est irreversible</p>
                        <p>tes vous sr de vouloir continuer ?</p>
                    </>
                )}

            </SlideDialog>
            <Snackbar
            anchorOrigin={{vertical: 'bottom', horizontal: 'center'}}
            open={isConnexionSnackOpen}
            autoHideDuration={3000}
            onClose={closeSnack}
            message="Bad credentials"
            action={action}
            />
        </React.Fragment >
    );
}

export default NavBar;
